import '../styling/index.sass'

import Navbar from '../components/Navbar'

function App({ Component, pageProps }) {
	return (
		<div className='bg-accent font-display p-8 lg:p-12 min-h-full'>
			<Navbar />
			<div className='w-3/5 mx-auto mt-24'>
				<Component {...pageProps} />
			</div>
		</div>
	)
}

export default App
